When people are asked location of their medicine chest , most people say &ldquo;Somewhere in a drawer&rdquo;. &nbsp;Then, when unexpected accidents happen, people might be easily in panic. In this situation, it is difficult to remember where a first-aid kit (F.A.K) is, and patients may not properly get treated in time due to this issue. &nbsp;This is because of the fact that most medicine chest design is not such sophisticated and even dull, which cause people to put it in somewhere in a drawer like they said.&nbsp;

I designed First aid kit with red-cross shape which can prevent such circumstance mentioned above as it grabs eyes easily at once.&nbsp;

In addition, as it is sophisticatedly designed, it is good for decoration.&nbsp;


&nbsp;

This is designed that each component has its respective space to fit perfectly. Therefore, it is always well-organized so that there is no time consuming to find what you need. Also, n order to keep hygiene of cotton swabs and band-aids, it has 2 &nbsp;lids, opened sharing one hinge, inside of kit.&nbsp;

